    "rek_title": "Non-coding RNAs in Mammary Gland Development and Disease",
    "rek_description": "Non-coding RNAs (ncRNAs) are untranslated RNA molecules that function to regulate the expression of numerous genes and associated biochemical pathways and cellular functions. NcRNAs include small interfering RNAs (siRNAs), microRNAs (miRNAs), PIWI-interacting RNAs (piRNAs), small nucleolar RNAs (snoRNAs) and long non-coding RNAs (lncRNAs). They participate in the regulation of all developmental processes and are frequently aberrantly expressed or functionally defective in disease. This Chapter will focus on the role of ncRNAs, in particular miRNAs and lncRNAs, in mammary gland development and disease.",
